import def from './def'
function App() {
  const [show, setShow] = useState(false);

  return (
    <nav className="nav__bar">
      <ul className="menu">
        <li className="menu__icon" onClick={() => setShow(true)}>
          <box-icon name="menu" color="floralwhite" size="md" />
          <def />
        </li>
      </ul>
    </nav>
  );
}

export default App;
